import React, { Fragment } from "react";
import { toast } from "react-toastify";

const Logout = () => {
const setAuth = true;
const logout = (e) => {
    e.preventDefault();
    localStorage.removeItem("token");
    setAuth(false);
    toast.success("Logged out succsessfully!");
  }

  return(
      <Fragment>
             <button
            className="btn btn-primary float-right"
            onClick={(e) => logout(e)}
          >
            Logout
          </button>
      </Fragment>
  )


};


export default Logout;
